const initialState = {
  data: []
};

const Reducer = (state = initialState, action) => {
  switch (action.type) {
    case "ADD_VEHICLE":
      return {
        data: [...state.data, action.payload]
      };
    default:
      return state;
  }
};

export default Reducer;
